import React from 'react';
import Userinput from "./languages";

class Show extends React.Component {

  render() {

    return(
      <div>

        <h2>Search Results!</h2>

        Job Type: { this.props. type }
        URL: { this.props. url }
        { this.props. created_at }
        { this.props. company }
        { this.props. company_url }
        { this.props. location }
        { this.props. job_title }
        { this.props. description }
        { this.props. company_logo }
        { this.props. how_to_apply }
        { this.props. error }

      </div>
    );
  }
};


export default App;
